const Nav=()=>{
    return(
        <div>
            <div class="ui three item menu">
                <Link to="/Home"><a class="item">Home</a></Link>
                <Link to="/Form"><a class="item">Add Student</a></Link>
                <a class="item">Update Student</a>
            </div>
        </div>
    )
}
export default Nav
